@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix atm: <http://www.example.com/atm#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

atm:ATM rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:enforceDailyWithdrawalLimit ;
    owl:hasValue 500 ;
    owl:allValuesFrom xsd:integer ] .

atm:UserAccount rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:enforceDailyWithdrawalLimit ;
    owl:hasValue 500 ;
    owl:allValuesFrom xsd:integer ] .
